import React from "react";
import Moment from "moment";
import { extendMoment } from "moment-range";

const moment = extendMoment(Moment);

const start = new Date("September 03, 2018");
const end = new Date();
const range = moment.range(start, end);
const rangeOfYear = range.diff("years");
const anniversaryDate = moment(start).add(rangeOfYear, "years");

function Animate() {
  return (
    <div className="slide-content">
      <div className="slide-subtitle">
        {/* <h4>GOT MARRIED</h4> */}
      </div>
      <div className="slide-title">
        <h1>Happy {rangeOfYear} Year Anniversary</h1>
        <p>Anniversary Date: {anniversaryDate.format("MMMM D, YYYY")}</p>
      </div>
      <div className="slide-text"></div>

      <div className="animation-pulse">
        <div className="animated-circle"></div>
      </div>
    </div>
  );
}

export default Animate;
